import React from "react";

function Incomes() {
    return (
        <>
            <div className="col-span-6 bg-white bg-opacity-75 rounded-md p-4">
                <form className="flex flex-col col-span-3 items-center gap-5 text-orange-400">
                    <input type='text' placeholder="Salary Title" className="border-blue-900 border-2 rounded-md w-[35vw] focus:outline-none" name='title'></input>
                </form>
            </div>
        </>
    )
}

export default Incomes;
